# R para análise de dados

- O R é a linguagem mais utilizada no **mundo** para análises de dados, na frente de linguagens como Python e SQL 

- Seu uso não se resume a isso: como é uma linguagem amadurecida, amplamente utilizada e de código aberto, seus usuários/desenvolvedores a todo momento acrescentam novas funcionalidades

# Gráficos e Visualizações

---
# ggplot2



```r
histogram &lt;- ggplot(mpg, aes(x = displ)) +
  geom_histogram(aes(fill = class),  binwidth = .1, 
                   col = "black", size=.1) +  
  labs(title="Exemplo de histograma",
      x = "Cilindradas", y = "Contagem",fill = "Classe")  + 
  scale_fill_brewer(palette = "Spectral")+
  theme_minimal()+theme(legend.position = "bottom")

histogram
```

# plotly


```r
btc &lt;- rio::import("~/Downloads/btc.csv") 

plot_ly(btc, x =~Date, y= ~Price ) %&gt;% add_lines()

library(rayshader)
ggdiamonds &lt;- ggplot(diamonds) +
  stat_density_2d(aes(x = x, y = depth, 
                      fill = stat(nlevel)),
                  geom = "polygon", n = 100, 
                  bins = 10, contour = TRUE) +
  facet_wrap(clarity~.) +
  scale_fill_viridis_c(option = "A")

par(mfrow = c(1, 2))

plot_gg(ggdiamonds, width = 5,
        height = 5, raytrace = FALSE, 
        preview = TRUE)

plot_gg(ggdiamonds, width = 5, 
        height = 5, multicore = TRUE, 
        scale = 250,
        zoom = 0.7, theta = 10, 
        phi = 30, windowsize = c(800, 800))

render_snapshot(clear = TRUE)
```
